import React, { Component } from 'react';

const Navbar = () => {
  return (
    <nav className="avbar bg-primary">
      <h1>
        <i className={this.props.icon} /> {this.props.title}
      </h1>
    </nav>
  );
};
Navbar.defaultProps = {
  title: 'Github Finder',
  icon: 'fab fa-github',
};
export default Navbar;
